// Name: mailto: Protocol
// ID: mailtoprotocol
// Description: Allows for easy usage of the mailto: protocol
// Note: This is a better version of TurboWarp/extensions #1651 <https://github.com/TurboWarp/extensions/pull/1651> by unknown07724
// By: RBryanYT <https://scratch.mit.edu/users/a_Gameer0438791>
// License: MIT

(function(Scratch) {
	const menuIcon = "data:image/png;base64,";

	'use strict';

	if (!Scratch.extensions.unsandboxed) {
		throw new Error("mailto: Protocol must run unsandboxed!");
	}

	const parseOrEmptyObject = (str) => {
		try {
			const obj = JSON.parse(str);
			if (obj && typeof obj === "object") return obj;
		} catch (e) {
			return {};
		}
	};

	class DiscordHook {
		getInfo() {
			return {
				id: 'mailtoprotocol',
				name: "mailto: Protocol",
				color1: "#deb431",
				color2: "#edca5b",
				color3: "#ffe68f",
				menuIconURI: menuIcon,
				blocks: [
					{
						opcode: 'sendemail',
						blockType: Scratch.BlockType.COMMAND,
						text: 'send email to [ADDRESS] cc: [CC] bcc: [BCC] subject: [SUBJECT] body: [BODY]',
						arguments: {
							ADDRESS: {
								type: Scratch.ArgumentType.STRING,
								defaultValue: "email@website.com"
							},
							CC: {
								type: Scratch.ArgumentType.STRING,
								defaultValue: ""
							},
							BCC: {
								type: Scratch.ArgumentType.STRING,
								defaultValue: ""
							},
							SUBJECT: {
								type: Scratch.ArgumentType.STRING,
								defaultValue: ""
							},
							BODY: {
								type: Scratch.ArgumentType.STRING,
								defaultValue: ""
							}
						}
					},
					{
						opcode: 'emailjoin',
						blockType: Scratch.BlockType.REPORTER,
						text: '[A]; [B]',
						arguments: {
							A: {
								type: Scratch.ArgumentType.STRING,
								defaultValue: "email@website.com"
							},
							B: {
								type: Scratch.ArgumentType.STRING,
								defaultValue: "email@website.com"
							}
						}
					},
					"---",
					{
						opcode: 'emailprovider',
						blockType: Scratch.BlockType.REPORTER,
						text: 'get email provider of [ADDRESS]',
						arguments: {
							ADDRESS: {
								type: Scratch.ArgumentType.STRING,
								defaultValue: "email@website.com"
							}
						}
					}
				],
			};
		}
	
		sendemail(args) {
			ampneeded = false
			window.open(`mailto:${args.ADDRESS}${argsexist(args)}${ua(args, "CC", "cc", true)}${ua(args, "BCC", "bcc", false)}${ua(args, "SUBJECT", "subject", false)}${ua(args, "BODY", "body", false)}`, '_blank');
		}
		emailjoin(args) {
			return `${args.A}; ${args.B}`;
		}

		emailprovider(args) {
			if (args.ADDRESS.endsWith("@gmail.com"))
			{
				return "Gmail";
			}
			else if (args.ADDRESS.endsWith("@outlook.com"))
			{
				return "Outlook";
			}
			else if (args.ADDRESS.endsWith("@aol.com"))
			{
				return "AOL";
			}
			else if (args.ADDRESS.endsWith("@proton.me") || args.ADDRESS.endsWith("@protonmail.com"))
			{
				return "Proton Mail";
			}
			else if (args.ADDRESS.endsWith("@icloud.com") || args.ADDRESS.endsWith("@me.com") || args.ADDRESS.endsWith("@mac.com"))
			{
				return "iCloud";
			}
			else if (args.ADDRESS.endsWith("@yahoo.com") || args.ADDRESS.endsWith("@myyahoo.com"))
			{
				return "Yahoo!";
			}
			else if (args.ADDRESS.endsWith("@gmx.com") || args.ADDRESS.endsWith("@gmx.us"))
			{
				return "GMX";
			}
			else if (args.ADDRESS.includes("@"))
			{
				return args.ADDRESS.split("@", 2)[1]
			}
			else
			{
				return "Failed to get email provider"
			}
		}
	}
	Scratch.extensions.register(new DiscordHook());

	var ampneeded = false;

	//           USE ARGUMENT?            //
	//  =------------------------------=  //
	//  Checks if arg is empty, if not,   //
	//  adds the argument to the mailto:  //
	//  link. (Also argl is the link's    //
	//  argument name, not TurboWarp's.)  //
	function ua(turbowarpargs, arg, argl) {
		let addqst = "";
		if (ampneeded) {
			addqst = "&";
		}
		else {
			addqst = "";
			ampneeded = true;
		}

		if (!eval(`turbowarpargs.${arg} == ""`))
		{
			return(`${addqst}${argl}=${eval(`turbowarpargs.${arg}`)}`);
		}
		else
		{
			return "";
		}
	}

	function argsexist(turbowarpargs) {
		if (!turbowarpargs.CC == "" || !turbowarpargs.BCC == "" || !turbowarpargs.SUBJECT == "" || !turbowarpargs.TITLE == "") {
			return "?";
		}
		else {
			return "";
		}
	}
})(Scratch);
